{يتنفسون هواء تركيا وينعمون فيها وقلوبهم سوداء يتمنون خرابها}
● رجب طيب أردوغان ●
والرئيس يقصد بعض المعارضين الأتراك وأنا أضيف لما سبق بعض الأجانب المقيمين فيها فتركيا عدوها الحقيقي في الداخل لا في الخارج ولن تهزم تركيا أبدا بعدو خارجي لذا عليها بتنظيف الداخل من أعدائها الألداء
